/**
 * Allows multiple values per ControlType, provided as an array via props.
 *
 * @remarks
 *
 * For most control types this control will be displayed as an additional section within the properties panel allowing as many fields to be provided as required.
 *
 * For a {@link ControlType.ComponentInstance} the Frame will also gain an additional outlet UI that allows links to be dragged between frames.
 * ```typescript
 * interface Props {
 *   images: string[],
 *   children: React.ReactNode[]
 * }
 * static propertyControls: PropertyControls<Props> = {
 *   images: {
 *     type: ControlType.Array,
 *     propertyControl: {
 *       type: ControlType.Image
 *     }
 *   },
 *   children: {
 *     type: ControlType.Array,
 *     propertyControl: {
 *       type: ControlType.ComponentInstance
 *     }
 *   },
 * }
 * ```
 *
 */

/**
 * Represents a color value, will be provided as a string via props.
 *
 * @remarks
 *
 * This control is displayed as a color picker and will provide the selected color in either hex (e.g. `"#afafaf"`) or hsl (e.g. `hsla(203, 87%, 50%, 0.43)`) notation depending on whether there is a alpha channel.
 * ```typescript
 * interface Props {
 *   background: string
 * }
 * static propertyControls: PropertyControls<Props> = {
 *   background: {
 *     type: ControlType.Color,
 *     defaultValue: "#ffffff", // Optional default color
 *   },
 * }
 * ```
 *
 */

/**
 * A reference to another component on the canvas, provided via a prop.
 *
 * @remarks
 *
 * The component will have an outlet to allow dragging a link to another Frame. Available frames will also be displayed in a pop-up in the properties panel. The component reference will be provided as a prop, as a convention the name for the prop is usually just `children`.
 *
 * Multiple components can be linked by combining the `ComponentInstance` type with the {@link ControlType.Array}.
 * ```typescript
 * interface Props {
 *   children: React.ReactNode
 * }
 * static propertyControls: PropertyControls<Props> = {
 *   children: {
 *     type: ControlType.ComponentInstance,
 *   },
 * }
 * ```
 *
 */

/**
 * Represents an image resource, will be provided as url via props.
 *
 * @remarks
 *
 * Displayed as an file picker that will open a native file browser. The selected file will be provided as a fully qualified url. The `allowedFileTypes` property must be provided to specify acceptable file types.
 * ```typescript
 * interface Props {
 *   asset: string
 * }
 * static propertyControls: PropertyControls<Props> = {
 *   asset: {
 *     type: ControlType.File,
 *     allowedFileTypes: ["pdf"], // Accepted file types
 *   },
 * }
 * ```
 *
 */

/**
 * Represents an image resource, will be provided as url via props.
 *
 * @remarks
